description:
Phoebe in Wonderland (2008)  

Verenigde Staten
Drama
96 minuten

geregisseerd door Daniel Barnz
met Felicity Huffman, Elle Fanning en Bill Pullman

Phoebe heeft het helemaal gehad met de grote mensenwereld en vooral al haar regeltjes. Het enige lichtpunt in haar leven is haar onconventionele dramalerares die Phoebe inspireert het leven van haar hele familie op de kop te zetten.


